/*取幂函数*/
function p(base, power) {
    if (1 == power)
        return base
    if (0 == power)
        return 1;
    var result = base;
    for (var i = 0; i < power - 1; i++) {
        result = result * base;
    }
    return result;
}

/*取复利*/
function fuli(rate, year) {
    var result = 0;
    for (var i = year; i > 0; i--) {
        result += p(rate, i);
    }
    return result;
}

function calc() {
    var initMoney = getNumberValue("initMoney"); // 起始资金
    var rate = getNumberValue("rate") + 0.0; // 每年收益率
    var year = getNumberValue("year"); // 复利年数
    var each = getNumberValue("each"); // 每年追加
    var sum1 = (year - 1) * each + initMoney;
    var sum3 = each * fuli((1 + rate / 100), (year - 1)) + initMoney * p((1 + rate / 100), year);

    var sum2 = sum3 - sum1;
    setValue("sum1", sum1); // 输出本金合
    setValue("sum2", sum2); // 输出利息和
    setValue("sum3", sum3); // 输出本息
}

function setValue(id, value) {
    document.getElementById(id).value = value;
}

function getNumberValue(id) {
    return parseFloat(document.getElementById(id).value);
}

